        public static int ma;

        static int steadyGene(string gene)
        {
            int min = 1000000000;
            ma = gene.Length / 4;

            Dictionary<char, int> mTot = getDictCount(gene);
            if (isSteady(mTot))
            {
                return 0;
            }

            Dictionary<char, List<int>> mPos = new Dictionary<char, List<int>>();
            mPos.Add('A', new List<int>());
            mPos.Add('C', new List<int>());
            mPos.Add('G', new List<int>());
            mPos.Add('T', new List<int>());

            Dictionary<int, int> mI = new Dictionary<int, int>();
            Dictionary<int, int> mIA = new Dictionary<int, int>();
            Dictionary<int, int> mIC = new Dictionary<int, int>();
            Dictionary<int, int> mIG = new Dictionary<int, int>();
            Dictionary<int, int> mIT = new Dictionary<int, int>();
            int iA = 0;
            int iC = 0;
            int iG = 0;
            int iT = 0;

            for (int i = 0; i < gene.Length; i++)
            {
                mPos[gene[i]].Add(i);

                switch (gene[i])
                {
                    case 'A':
                        mI.Add(i, iA);
                        mIA.Add(i, iA);
                        iA++;
                        break;
                    case 'C':
                        mI.Add(i, iC);
                        mIC.Add(i, iC);
                        iC++;
                        break;
                    case 'G':
                        mI.Add(i, iG);
                        mIG.Add(i, iG);
                        iG++;
                        break;
                    case 'T':
                        mI.Add(i, iT);
                        mIT.Add(i, iT);
                        iT++;
                        break;
                }
            }

            Dictionary<char, int> gCut = new Dictionary<char, int>();
            gCut.Add('A', getValueCut(mTot, 'A'));
            gCut.Add('C', getValueCut(mTot, 'C'));
            gCut.Add('G', getValueCut(mTot, 'G'));
            gCut.Add('T', getValueCut(mTot, 'T'));

            int count = 0;
            int nA = 0;
            int nC = 0;
            int nG = 0;
            int nT = 0;
            int pA = 0;
            int pC = 0;
            int pG = 0;
            int pT = 0;
            int maxV = 0;
            char cA = '_';
            char cC = '_';
            char cG = '_';
            char cT = '_';

            int[] mp;
            int[] mpA = new int[0];
            int[] mpC = new int[0];
            int[] mpG = new int[0];
            int[] mpT = new int[0];
            foreach (KeyValuePair<char, int> e in gCut.Where(e => e.Value > 0))
            {
                count += 1;

                if (e.Key == 'A')
                {
                    mpA = mPos[e.Key].ToArray();
                    nA = e.Value;
                    pA = mpA[0];
                    cA = e.Key;
                }
                else if (e.Key == 'C')
                {
                    mpC = mPos[e.Key].ToArray();
                    nC = e.Value;
                    pC = mpC[0];
                    cC = e.Key;
                }
                else if (e.Key == 'G')
                {
                    mpG = mPos[e.Key].ToArray();
                    nG = e.Value;
                    pG = mpG[0];
                    cG = e.Key;
                }
                else if (e.Key == 'T')
                {
                    mpT = mPos[e.Key].ToArray();
                    nT = e.Value;
                    pT = mpT[0];
                    cT = e.Key;
                }

                if (e.Value > maxV)
                {
                    maxV = e.Value;
                }

            }

            if (count == 1 && maxV == 1)
            {
                return 1;
            }

            int nCut = nA + nC + nG + nT;
            int dist = 0;

            mp = new int[nCut];
            mp = mpA.Concat(mpC).Concat(mpG).Concat(mpT).OrderBy(x => x).ToArray();

            int k = 0;
            int start = 0;
            int end = 0;
            int endA = 0;
            int endC = 0;
            int endG = 0;
            int endT = 0;
            int g = 0;

            while (g + nCut - 1 < mp.Count())
            {
                start = mp[g];

                if (nA > 0)
                {
                    endA = findL(mpA, start, gene, cA, nA, mIA);
                    if (endA > end) { end = endA; }
                }
                else
                {
                    endA = 1;
                }
                if (nC > 0)
                {
                    endC = findL(mpC, start, gene, cC, nC, mIC);
                    if (endC > end) { end = endC; }
                }
                else
                {
                    endC = 1;
                }
                if (nG > 0)
                {
                    endG = findL(mpG, start, gene, cG, nG, mIG);
                    if (endG > end) { end = endG; }
                }
                else
                {
                    endG = 1;
                }
                if (nT > 0)
                {
                    endT = findL(mpT, start, gene, cT, nT, mIT);
                    if (endT > end) { end = endT; }
                }
                else
                {
                    endT = 1;
                }

                if (endA > 0 && endC > 0 && endG > 0 && endT > 0)
                {
                    dist = end - start + 1;

                    if (dist >= 0 && dist < min)
                    {
                        min = dist;
                    }
                }

                g += 1;
            }

            return min;
        }

        static int findL(int[] mpT, int start, string gene, char c, int nT, Dictionary<int,int> mIT)
        {
            int endT = 0;
            int startT = 0;

            if (start >= mpT[0] && start <= mpT[mpT.Length - 1])
            {
                if (gene[start].Equals(c))
                {
                    startT = start;
                }
                else
                {
                    startT = gene.IndexOf(c, start);

                }
                if (mIT[startT] + nT - 1 < mpT.Length)
                {
                    endT = mpT[mIT[startT] + nT - 1];
                }
                else
                {
                    return -10;
                }
            }
            else
            {
                return -10;
            }

            return endT;
        }

        static Dictionary<char, int> getDictCount(string str)
        {
            Dictionary<char, int> t = (from a in str.ToCharArray().GroupBy(x => x) select a).ToDictionary(
                                                                            p => p.Key,
                                                                            p => p.Count()
                                                                            );

            Dictionary<char, int> mTot = new Dictionary<char, int>();
            mTot.Add('A', getValueMap(t, 'A'));
            mTot.Add('C', getValueMap(t, 'C'));
            mTot.Add('G', getValueMap(t, 'G'));
            mTot.Add('T', getValueMap(t, 'T'));

            return mTot;
        }

        static int getValueMap(Dictionary<char, int> t, char e)
        {
            int v = 0;
            t.TryGetValue(e, out v);
            return v;
        }

        static int getValueCut(Dictionary<char, int> t, char e)
        {
            int v = 0;
            t.TryGetValue(e, out v);
            int r = v - ma;
            if (r < 0)
            {
                return 0;
            }
            return r;
        }

        static bool isSteady(Dictionary<char, int> t)
        {
            if (t['A'] == ma && t['A'] == t['C'] && t['A'] == t['G'] && t['A'] == t['T'])
            {
                return true;
            }

            return false;
        }



